【商品説明】<br>クリーミィなもっちり泡が髪１本１本をパックするようにタレずに密着。ムラなくキレイに染まります。くるくる混ぜて手で塗るだけ、楽しく簡単な泡のヘアカラー。<br><br>成分：<BR>１剤：ｂｒ［有効成分］：塩酸２４－ジアミノフェノキシエタノール、パラフェニレンジアミン、メタアミノフェノールｂｒ［その他の成分］：亜硫酸ナトリウム、アンモニア水、エデト酸四ナトリウム四水塩、塩化ジメチルジアリルアンモニウム・アクリルアミド共重合体液、オレンジ果汁、海藻エキス（４）、加水分解シルク液、カルボキシビニルポリマー、精製水、セタノール、炭酸水素アンモニウム、大豆たん白加水分解物、ツバキ油、濃グリセリン、パラオキシ安息香酸プロピル、パラオキシ安息香酸メチル、ポリオキシエチレンステアリルエーテル、ポリオキシエチレンラウリルエーテル硫酸ナトリウム、モモ果汁、リンゴ果汁、レゾルシン、レモン果汁、Ｌ－アスコルビン酸、１３－ブチレングリコール、香料ｂｒｂｒ２剤：ｂｒ［有効成分］：過酸化水素ｂｒ［その他の成分］：ジエチレングリコールモノエチルエーテル、精製水、セタノール、セチル硫酸ナトリウム、ヒドロキシエタンジホスホン酸液、フェノキシエタノール、プロピレングリコール、ポリオキシエチレンセチルエーテル、リン酸ｂｒｂｒつばきオイル配合のヘア美容液：ｂｒ成分水、ＢＧ、ジメチコン、ジリノール酸ジイソプロピル、ミネラルオイル、ステアリルアルコール、ステアリン酸ソルビタン、ステアリン酸ＰＥＧ－２５、カルボマー、キサンタンガム、グリセリン、水酸化Ｋ、ツバキ油、ブチルパラベン、メチルパラベン、ユチャ油、ＥＤＴＡ－２Ｎａ、ＰＥＧ－４０水添ヒマシ油、香料<br>使用上の注意：<BR>ご購入前・ご使用前に必ずお読みください。●ご使用の際は、必ず使用説明書をよく読んで正しくお使いください。●へアカラーはまれに重いアレルギー反応をおこすことがあります。●次の方は使用しないでください。・今までに本品に限らずへアカラーでかぶれたことのある方。・今までに染毛中または直後に気分の悪くなったことのある方。・頭皮あるいは皮膚が過敏な状態になっている方。（病中、病後の回復期、生理時、妊娠中等。）・頭、顔、首筋にはれもの、傷、皮膚病がある方。●ご使用の際には、使用説明書にしたがい、毎回必ず染毛の４８時間前に皮膚アレルギー試験（パッチテスト）をしてください。●薬剤や洗髪時の洗い液が目に入らないようにしてください。●眉毛、まつ毛には使用しないでください。●幼小児の手の届かないところに保管してください。●高温や直射日光を避けて保管してください。※幼小児には、使用しないでください。※混合薬剤は、容器に入ったままで放置しないでください。ガスが発生し、あふれ出て、周りを汚すおそれがあります。※残った混合薬剤は効果がありませんので、必ず捨ててください。※食品ではありません。<br>保管および取扱い上の注意：<BR>高温や直射日光を避けて保管して下さい。乳幼児・小児の手のとどかない所に保管してください。<br>商品区分：医薬部外品<br>問い合わせ先：<BR>株式会社ダリヤ。〒４６０‐０００２。愛知県名古屋市中区丸の内３‐５‐２４　０５２‐９５０‐７７１１<br>原産国：日本<br>商品サイズ：88×175×88<BR><br>JANコード：4904651182022<BR>cs：24<BR><br><br>成分：１剤：ｂｒ［有効成分］：塩酸２４－ジアミノフェノキシエタノール、パラフェニレンジアミン、メタアミノフェノールｂｒ［その他の成分］：亜硫酸ナトリウム、アンモニア水、エデト酸四ナトリウム四水塩、塩化ジメチルジアリルアンモニウム・アクリルアミド共重合体液、オレンジ果汁、海藻エキス（４）、加水分解シルク液、カルボキシビニルポリマー、精製水、セタノール、炭酸水素アンモニウム、大豆たん白加水分解物、ツバキ油、濃グリセリン、パラオキシ安息香酸プロピル、パラオキシ安息香酸メチル、ポリオキシエチレンステアリルエーテル、ポリオキシエチレンラウリルエーテル硫酸ナトリウム、モモ果汁、リンゴ果汁、レゾルシン、レモン果汁、Ｌ－アスコルビン酸、１３－ブチレングリコール、香料ｂｒｂｒ２剤：ｂｒ［有効成分］：過酸化水素ｂｒ［その他の成分］：ジエチレングリコールモノエチルエーテル、精製水、セタノール、セチル硫酸ナトリウム、ヒドロキシエタンジホスホン酸液、フェノキシエタノール、プロピレングリコール、ポリオキシエチレンセチルエーテル、リン酸ｂｒｂｒつばきオイル配合のヘア美容液：ｂｒ成分水、ＢＧ、ジメチコン、ジリノール酸ジイソプロピル、ミネラルオイル、ステアリルアルコール、ステアリン酸ソルビタン、ステアリン酸ＰＥＧ－２５、カルボマー、キサンタンガム、グリセリン、水酸化Ｋ、ツバキ油、ブチルパラベン、メチルパラベン、ユチャ油、ＥＤＴＡ－２Ｎａ、ＰＥＧ－４０水添ヒマシ油、香料<br>使用上の注意：ご購入前・ご使用前に必ずお読みください。●ご使用の際は、必ず使用説明書をよく読んで正しくお使いください。●へアカラーはまれに重いアレルギー反応をおこすことがあります。●次の方は使用しないでください。・今までに本品に限らずへアカラーでかぶれたことのある方。・今までに染毛中または直後に気分の悪くなったことのある方。・頭皮あるいは皮膚が過敏な状態になっている方。（病中、病後の回復期、生理時、妊娠中等。）・頭、顔、首筋にはれもの、傷、皮膚病がある方。●ご使用の際には、使用説明書にしたがい、毎回必ず染毛の４８時間前に皮膚アレルギー試験（パッチテスト）をしてください。●薬剤や洗髪時の洗い液が目に入らないようにしてください。●眉毛、まつ毛には使用しないでください。●幼小児の手の届かないところに保管してください。●高温や直射日光を避けて保管してください。※幼小児には、使用しないでください。※混合薬剤は、容器に入ったままで放置しないでください。ガスが発生し、あふれ出て、周りを汚すおそれがあります。※残った混合薬剤は効果がありませんので、必ず捨ててください。※食品ではありません。<br>保管および取扱い上の注意：高温や直射日光を避けて保管して下さい。乳幼児・小児の手のとどかない所に保管してください。<br>商品区分：医薬部外品<br>問い合わせ先：株式会社ダリヤ。〒４６０‐０００２。愛知県名古屋市中区丸の内３‐５‐２４　０５２‐９５０‐７７１１<br>原産国：日本<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
